import React, {Component} from 'react';
import './../styles/Login.css';
import BasicButton from './Common/BasicButton';

class Register extends Component {
    handleClick() {
        alert("I was clicked!");
    }
    render() {
        return(
            <div className='Login'>
              <h1 className = 'Login-header'>Register a new user</h1>
              <div className='Login-input' style={{color:Colors.blue}}>Username: <input type="text" className="Login-box" onChange={this.handleChangeUsername}/></div>
              <div>Enter new username: <input type='text' placeholder='Username'/></div>
              <div>Enter new password: <input type='text' placeholder='Password'/></div>
              <BasicButton label={'Register'} onClick={this.handleClick}/>
            </div>
        );
    }
}

export default Register;
